#include <stdio.h>
#include <stdlib.h>
#include <math.h>
#include <string.h>
#include <time.h>

#define EMPTY '-'
#define CIRCLE '1'
#define CROSS '2'
#define LEN(arr1) ((int) (sizeof (arr1) / sizeof (arr1)[0]))


int returnRandom(int lower, int upper) {
    return (rand() % (upper-lower)) + lower; // end exclusive
}

struct Player {
    char name[51];
    char avatar[17][36];
    int length;
};

struct TicTacToe {
    char state[10];
    int marker;
};

void init_reset(struct TicTacToe *ttt, int turn_n) {
    for (int i=0; i<9; i++) {
        ttt->state[i] = EMPTY;
    }
    ttt->marker = (turn_n) ? 1 : 0;
}

int gameEnds(struct TicTacToe ttt) {
    char mm = (ttt.marker) ? CIRCLE : CROSS;
    // 0: continue; 1: won; 2: draw;
    if ((ttt.state[0] == ttt.state[4] && ttt.state[4] == ttt.state[8] && ttt.state[8] == mm) || (ttt.state[2] == ttt.state[4] && ttt.state[4] == ttt.state[6] && ttt.state[6] == mm)) {
        return 1;
    }
    for (int i=0; i<3; i++) {
        if ((ttt.state[3*i] == ttt.state[3*i+1] && ttt.state[3*i+1] == ttt.state[3*i+2] && ttt.state[3*i+2] == mm) || (ttt.state[i] == ttt.state[i+3] && ttt.state[i+3] == ttt.state[i+6] && ttt.state[i+6] == mm)) {
            return 1;
        }
    }
    for (int i=0; i<9; i++) {
        if (ttt.state[i] == EMPTY) {
            return 0;
        }
    }
    return 2;
}

struct rstates {
    char state[10];
    int move;
};

struct TabularQLearningAgent {
    double alpha;
    double d;
    double init_;
    struct rstates recordedStates[9];
    double q_values[9];
    double reward;
};


void get_q(struct TicTacToe ttt, struct TabularQLearningAgent *ag1, char keys[19690][10], double res[19690][10]) {
    int cnt = 2;
    int val = 0;
    while (((int) keys[cnt][0]) != 0) {
        if (strcmp(keys[cnt], ttt.state) == 0) {
            for (int i=0; i<9; i++) {
                ag1->q_values[i] = res[cnt][i];
            }
            val = 1;
        }
        cnt += 1;
    }
    if (val == 0) {
        for (int i=0; i<9; i++) {
            keys[cnt][i] = ttt.state[i];
            res[cnt][i] = (ttt.state[i] == EMPTY) ? ag1->init_ : -INFINITY;
            ag1->q_values[i] = res[cnt][i];
        }
    }
}

void printGameBoard(char gameBoard[10]) {
    printf("=========\n");
    for (int i=0; i<9; i++) {
        if (i % 3 == 0 && i != 0) {
            printf("\n");
        }
        printf("|");
        if (gameBoard[i] == EMPTY) {
            printf("%d", i+1);
        } else if (gameBoard[i] == CIRCLE) {
            printf("O");
        } else {
            printf("X");
        }
        printf("|");
    }
    printf("\n=========\n\n");
}

int playMoveRandom(struct TicTacToe ttt) {
    int score = 0;
    int turn = 1;
    char round[6][64] = {".______        ______    __    __  .__   __.  _______      __ ", "|   _  \\      /  __  \\  |  |  |  | |  \\ |  | |       \\    /_ |", "|  |_)  |    |  |  |  | |  |  |  | |   \\|  | |  .--.  |    | |", "|      /     |  |  |  | |  |  |  | |  . `  | |  |  |  |    | |", "|  |\\  \\----.|  `--\'  | |  `--\'  | |  |\\   | |  \'--\'  |    | |", "| _| `._____| \\______/   \\______/  |__| \\__| |_______/     |_|"};
    printf("\n");
    for (int i=0; i<6; i++) {
        printf("%s\n", round[i]);
    }
    for (int k=0; k<2; k++) {
        printf("\nChallenging RandomMoveDummy:\n\n");
        init_reset(&ttt, turn);
        int currentPlayer = turn;

        while (gameEnds(ttt) < 1) {
            int move;
            if (currentPlayer) {
                printGameBoard(ttt.state);
                printf("Your move (1-9): ");
                scanf("%d", &move);
                while (ttt.state[move-1] != EMPTY || (move > 9) || (move < 1)) {
                    printf("Invalid move! Please try again.\n");
                    printf("Your move (1-9): ");
                    scanf("%d", &move);
                }
                move --;
            } else {
                int cnt=0;
                int idxs[9];
                for (int i=0; i<9; i++) {
                    if (ttt.state[i] == EMPTY) {
                        idxs[cnt] = i;
                        cnt += 1;
                    }
                }
                move = idxs[returnRandom(0, cnt)];
            }
            ttt.state[move] = (currentPlayer) ? CIRCLE : CROSS;
            ttt.marker = (currentPlayer) ? 1: 0;
            int end = gameEnds(ttt);
            if (end == 1) {
                printGameBoard(ttt.state);
                if (currentPlayer) {
                    printf("You win!\n");
                    score += 100;
                } else {
                    printf("RandomMoveDummy wins!\n");
                }
            } else {
                if (end == 2) {
                    printGameBoard(ttt.state);
                    printf("You draw!\n");
                    score += 50;
                }
            }
            currentPlayer = !currentPlayer;
        }
        turn = !turn;
    }
    return score;
}

int get_move(struct TicTacToe ttt, struct TabularQLearningAgent *ag1, int move_num) {
    int max_q[9];
    double max = ag1->q_values[0];
    for (int i=1; i<9; i++) {
        max = (ag1->q_values[i] > max) ? ag1->q_values[i] : max;
    }
    int cnt = 0;
    for (int i=0; i<9; i++) {
        if (ag1->q_values[i] == max) {
            max_q[cnt] = i;
            cnt += 1;
        }
    }
    int move = returnRandom(0, cnt); // select random max move
    for (int i=0; i<9; i++) {
        ag1->recordedStates[move_num].state[i] = ttt.state[i];
    }
    ag1->recordedStates[move_num].move = max_q[move];
    return max_q[move];
}


