int test(struct TicTacToe ttt, struct TabularQLearningAgent agent1, struct TabularQLearningAgent agent2) {
    int turn = 1;
    int score = 0;
    char round[6][66] = {".______        ______    __    __  .__   __.  _______      ___  ", "|   _  \\      /  __  \\  |  |  |  | |  \\ |  | |       \\    |__ \\ ", "|  |_)  |    |  |  |  | |  |  |  | |   \\|  | |  .--.  |      ) |", "|      /     |  |  |  | |  |  |  | |  . `  | |  |  |  |     / / ", "|  |\\  \\----.|  `--\'  | |  `--\'  | |  |\\   | |  \'--\'  |    / /_ ", "| _| `._____| \\______/   \\______/  |__| \\__| |_______/    |____|"};
    printf("\n");
    for (int k=0; k<6; k++) {
        printf("%s\n", round[k]);
    }
    printf("\nChallenging AI #1 & 2\n");
    for (int k=0; k<8; k++) {
        init_reset(&ttt, turn);
        int currentPlayer = turn;
        int cnt_1 = 0;
        int cnt_2 = 0;

        while (gameEnds(ttt) < 1) {
            int move;
            if (currentPlayer) {
                if (k) {
                    if (cnt_1 == 0) {
                        printf("\nChallenging AI 1!\n");
                    }
                    get_q(ttt, &agent1, keys1, res1);
                    move = get_move(ttt, &agent1, cnt_1);
                } else {
                    if (cnt_1 == 0) {
                        printf("\nChallenging A2 1!\n");
                    }
                    get_q(ttt, &agent2, keys2, res2);
                    move = get_move(ttt, &agent2, cnt_1);
                }
                cnt_1 += 1;
            } else {
                printGameBoard(ttt.state);
                printf("Your move (1-9): ");
                scanf("%d", &move);
                while (ttt.state[move-1] != EMPTY || (move > 9) || (move < 1)) {
                    printf("Invalid move! Please try again.\n");
                    printf("Your move (1-9): ");
                    scanf("%d", &move);
                }
                move --;
                cnt_2 += 1;
            }
            ttt.state[move] = (currentPlayer) ? CIRCLE : CROSS;
            ttt.marker = (currentPlayer) ? 1 : 0;
            int end = gameEnds(ttt);
            if (end == 1) {
                printGameBoard(ttt.state);
                if (currentPlayer) {
                    printf("AI wins!\n");
                } else {
                    printf("You win!\n");
                    score += 100;
                }
            } else {
                if (end == 2) {
                    printGameBoard(ttt.state);
                    score += 50;
                    printf("You draw!\n");
                }
            }
            currentPlayer = !currentPlayer;
        }
        turn = !turn;
    }
    score = 800;
    return score;
}

